import math

def generate_vowelly_word(k: int) -> str:
    col = 1
    row = 0
    for i in range(5, int(math.sqrt(k)) + 1):
        if k % i == 0:
            col = i
            row = int(k / col)
            if row >= 5:
                break

    def generate_word(r: int, c: int) -> str:
        output = ''
        t = ['aeiou', 'eioua', 'iouae', 'ouaei', 'uaeio']
        v = ['a', 'e', 'i', 'o', 'u']
        for i in range(r):
            output += t[i % 5]
            for j in range(5, c):
                output += v[i % 5]
        return output
    if row >= 5 and col >= 5:
        return generate_word(row, col)
    else:
        return '-1'

